  return (
    <Container>
      <Row>
        <Col sm={10}>
        <img src = "img1.jpg"></img>
        <img src = "img2.jpg"></img>
        <img src = "img3.jpg"></img>
        <img src = "img4.jpg"></img>
        </Col>
        <Col sm={2}>sm=2</Col>
      </Row>
    </Container>
  );
}

export default Layout;
